import { createRouter, createWebHistory } from 'vue-router';
import CoordinatorDashboard from './views/CoordinatorDashboard.vue';
import CoordinatorParticipants from './views/CoordinatorParticipants.vue';
import KeyTest from './views/KeyTest.vue';

const routes = [
  { path: '/', component: CoordinatorDashboard },
  { path: '/participants', component: CoordinatorParticipants },
  { path: '/key-test', component: KeyTest },
];

export default createRouter({
  history: createWebHistory(),
  routes,
});
